/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import LanguageIcon from '@material-ui/icons/Language';
import Divider from '@material-ui/core/Divider';
import AppleIcon from '@material-ui/icons/Apple';
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import TwitterIcon from '@material-ui/icons/Twitter';
import YouTubeIcon from '@material-ui/icons/YouTube';
// import useStyles from '../pages/MainPage/style';
import { makeStyles } from "@material-ui/styles";

const useStyles = makeStyles({
    links:{
        background: '#f2f2f2',
        color: '#616161',
        fontSize: '12px',


    },
    linksInner:{
        maxWidth: '1100px',
        margin: '0 auto',
        padding: '0 20px',
        display: 'grid',
        gridTemplateColumns: 'repeat(5, 1fr)',
        gridGap: '10px',
        alignItems: 'flex-start',
        justifyContent: 'center',
        "& >ul > li":{
            lineHeight: '2.8',
            listStyle:'none',
        }, 
        '& > ul > li > a': {
            textDecoration: 'none',
            display: 'block',
            color: 'grey'
        }

    },
    footer:{   
        display: 'flex',
        alignIitems: 'center',
        justifyContent: 'space-around',
        "& > div":{
            display: 'flex',
            alignItems: 'center',
        },
        "& > div > i":{
            marginRight: '10px',
        },
        "& > div > ul":{
            display: 'flex',
            flexWrap: 'wrap',
            listStyle:'none',
        },
        "& > div > ul > li":{
            marginRight: '30px',
            marginBottom: '20px',
        },
        '& > div > ul > li > a': {
            textDecoration: 'none',
            padding: '1rem',
            display: 'block',
            color: 'grey'
        }
    },
    divider:{
    marginTop: '50px',
    marginLeft: '215px'
    },

    footerRight:{

    "& > span > a ":{
        textDecoration : "none",
        color: 'grey',
    }
    },

});
const Footer = () => {

    const classes = useStyles();
    return(
        <>
        <section className={classes.links}>
                <div className={classes.linksInner}>
                    <ul>
                        <li><h3>Microsoft Store</h3></li>
                        <li><a href="#">Account Profile</a></li>
                        <li><a href="#">Download Center</a></li>
                        <li><a href="#">Returns</a></li>
                    </ul>
                    <ul>
                        <li><h3>Developer</h3></li>
                        <li><a href="#">Microsoft Visual Studio</a></li>
                        <li><a href="#">Developer Center</a></li>
                        <li><a href="#">Channel 9</a></li>
                    </ul>
                    <ul>
                        <li><h3>Company</h3></li>
                        <li><a href="#">Careers</a></li>
                        <li><a href="#">About Microsoft</a></li>
                        <li><a href="#">Company News</a></li>

                    </ul>
                    <ul>
                        <li><h3>Enterprise</h3></li>
                        <li><a href="#">Microsoft Azure</a></li>
                        <li><a href="#">Microsoft Partner Resources</a></li>
                    </ul>
                    <ul>
                        <li><h3>Education</h3></li>
                        <li><a href="#">Office 365 for schools</a></li>
                    </ul>
                </div>
                <Divider variant="inset" width="75%" className={classes.divider} />
                <footer className={classes.footer}>
                    <div className={classes.footerLeft}>
                        <ul>
                            <li><a href="#">Privacy </a></li>
                            <li><a href="#">Terms of use</a></li>
                            <li><a href="#">Trademarks</a></li>
                        </ul>
                    </div>
                    <div className={classes.footerRight}>
                        <LanguageIcon/>
                        <span><a href="#"><h2>EN</h2></a></span>
                        <ArrowDropDownIcon/>
                        <AppleIcon/>
                        <FacebookIcon/>
                        <TwitterIcon/>
                        <LinkedInIcon/>
                        <YouTubeIcon/>
                    </div>        
                </footer>
            </section>
        </>
    );
}
export default Footer;
